const Chart = ({buildingName, amount, dates, listaDeptos}) => {
    return (
        <div className="h-80">
            <h2 className="text-3xl text-center font-bold">Chart</h2>
            <div className="flex flex-row justify-center justify-around">

            {listaDeptos?.map((uniqueBuilding, buildingIndex) => (
                <div key={buildingIndex} className="my-8 flex flex-row ">
                    <button onClick={e=>buildingName(e.target.value)} className="bg-white hover:bg-yellow-200 text-gray-800 font-semibold py-2 px-4 border border-gray-400 rounded shadow ml-8 w-3/4" >{uniqueBuilding.property}</button>
                </div>
                    ))}
            </div>
        </div>
    )
}

export default Chart
